func TestReedSolomonScheme_repairSymbols(t *testing.T) {
	tests := []struct {
		name    string
		block   *block
		want    []*wire.RepairFrame
		wantErr bool
		scheme  reedSolomonScheme
	}{
		{
			name: "block not complete",
			block: &block{
				ssidToSourcePayload: map[protocol.SourceSymbolID][]byte{
					1: {0, 1, 2},
				},
				totNumSourceSymbols: 2,
				totNumRepairSymbols: 1,
			},
			want:    nil,
			wantErr: true,
		},
		{
			name: "source symbol length too big",
			block: &block{
				ssidToSourcePayload: map[protocol.SourceSymbolID][]byte{
					1: make([]byte, protocol.MaxFECPacketBufferSize+1),
					2: make([]byte, protocol.MaxFECPacketBufferSize),
				},
				totNumSourceSymbols:         2,
				totNumRepairSymbols:         1,
				biggestSourceSymbolLenSoFar: protocol.MaxFECPacketBufferSize + 1,
			},
			want:    nil,
			wantErr: true,
		},
		{
			name: "successful repair symbol generation with 6 source symbols and 2 repair symbols",
			scheme: reedSolomonScheme{enc: func() reedsolomon.Encoder {
				enc, err := reedsolomon.New(6, 2)
				if err != nil {
					t.Fatalf("failed to create reedsolomon encoder: %v", err)
				}
				return enc
			}()},
			block: &block{
				id: 0,
				ssidToSourcePayload: map[protocol.SourceSymbolID][]byte{
					1: generateLargePayloadReedSolomon(4, 0x1),
					2: generateLargePayloadReedSolomon(4, 0x2),
					3: generateLargePayloadReedSolomon(4, 0x3),
					4: generateLargePayloadReedSolomon(4, 0x4),
					5: generateLargePayloadReedSolomon(4, 0x5),
					6: generateLargePayloadReedSolomon(4, 0x6),
				},
				totNumSourceSymbols:         6,
				totNumRepairSymbols:         2,
				biggestSourceSymbolLenSoFar: 4,
				smallestSSID:                1,
				largestSSID:                 6,
			},
			want: []*wire.RepairFrame{
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  0,
						ParityID: 0,
					},
					Payload: []byte{23, 23, 23, 23, 0, 4},
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  0,
						ParityID: 1,
					},
					Payload: []byte{16, 16, 16, 16, 0, 4},
				},
			},
			wantErr: false,
		},
		{
			name: "successful repair symbol generation with 20 source symbols and 10 repair symbols",
			scheme: reedSolomonScheme{enc: func() reedsolomon.Encoder {
				enc, err := reedsolomon.New(20, 10)
				if err != nil {
					t.Fatalf("failed to create reedsolomon encoder: %v", err)
				}
				return enc
			}()},
			block: &block{
				id: 2,
				ssidToSourcePayload: map[protocol.SourceSymbolID][]byte{
					20: generateLargePayloadReedSolomon(600, 0x1),
					21: generateLargePayloadReedSolomon(650, 0x2),
					22: generateLargePayloadReedSolomon(700, 0x3),
					23: generateLargePayloadReedSolomon(750, 0x4),
					24: generateLargePayloadReedSolomon(800, 0x5),
					25: generateLargePayloadReedSolomon(850, 0x6),
					26: generateLargePayloadReedSolomon(900, 0x7),
					27: generateLargePayloadReedSolomon(950, 0x8),
					28: generateLargePayloadReedSolomon(1000, 0x9),
					29: generateLargePayloadReedSolomon(1050, 0xA),
					30: generateLargePayloadReedSolomon(1100, 0xB),
					31: generateLargePayloadReedSolomon(1150, 0xC),
					32: generateLargePayloadReedSolomon(1200, 0xD),
					33: generateLargePayloadReedSolomon(1250, 0xE),
					34: generateLargePayloadReedSolomon(1300, 0xF),
					35: generateLargePayloadReedSolomon(1350, 0x10),
					36: generateLargePayloadReedSolomon(1400, 0x11),
					37: generateLargePayloadReedSolomon(1434, 0x12),
					38: generateLargePayloadReedSolomon(600, 0x13),
					39: generateLargePayloadReedSolomon(650, 0x14),
				},
				totNumSourceSymbols:         20,
				totNumRepairSymbols:         10,
				biggestSourceSymbolLenSoFar: 1434,
				smallestSSID:                20,
				largestSSID:                 39,
			},
			want: []*wire.RepairFrame{
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 0,
					},
					Payload: r0,
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 1,
					},
					Payload: r1,
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 2,
					},
					Payload: r2,
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 3,
					},
					Payload: r3,
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 4,
					},
					Payload: r4,
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 5,
					},
					Payload: r5,
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 6,
					},
					Payload: r6,
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 7,
					},
					Payload: r7,
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 8,
					},
					Payload: r8,
				},
				{
					Metadata: protocol.BlockMetadata{
						BlockID:  2,
						ParityID: 9,
					},
					Payload: r9,
				},
			},
			wantErr: false,
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := tt.scheme.repairSymbols(tt.block)
			if (err != nil) != tt.wantErr {
				t.Errorf("repairSymbols() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if len(tt.want) != len(got) {
				t.Errorf("repairSymbols() error = slices not the same length")
				return
			}
			for i := 0; i < len(got); i++ {
				if !reflect.DeepEqual(got, tt.want) {
					t.Errorf("repairSymbols() got = %v, want %v", got[i].Payload, tt.want[i].Payload)
				}
			}
		})
	}
}

// generateLargePayload generates a byte slice of the given size filled with the specified value.
func generateLargePayloadReedSolomon(biggestSourceLenSoFar int, value byte) []byte {
	payload := make([]byte, 0, protocol.MaxPacketBufferSize)
	payload = payload[:biggestSourceLenSoFar]
	for i := 0; i < biggestSourceLenSoFar; i++ {
		payload[i] = value
	}
	return payload
}

func TestReedSolomonScheme_recoverSymbolPayloads(t *testing.T) {
	tests := []struct {
		name    string
		scheme  reedSolomonScheme
		block   *block
		want    []byte
		wantErr bool
	}{
		{
			name: "block not recoverable",
			block: &block{
				ssidToSourcePayload: map[protocol.SourceSymbolID][]byte{
					1: {0, 1, 2},
				},
				totNumSourceSymbols: 2,
				totNumRepairSymbols: 1,
			},
			want:    nil,
			wantErr: true,
		},
		{
			name: "block complete",
			block: &block{
				ssidToSourcePayload: map[protocol.SourceSymbolID][]byte{
					1: {0, 1, 2},
					2: {3, 4, 5},
				},
				totNumSourceSymbols: 2,
				totNumRepairSymbols: 1,
			},
			want:    nil,
			wantErr: false,
		},
		{
			name: "successful recovery",
			scheme: func() reedSolomonScheme {
				enc, err := reedsolomon.New(6, 2)
				if err != nil {
					t.Fatalf("failed to create reedsolomon encoder: %v", err)
				}
				return reedSolomonScheme{enc: enc}
			}(),
			block: &block{
				ssidToSourcePayload: map[protocol.SourceSymbolID][]byte{
					// 1: generateLargePayloadReedSolomon(4, 0x1),
					2: generateLargePayloadReedSolomon(4, 0x2),
					3: generateLargePayloadReedSolomon(4, 0x3),
					4: generateLargePayloadReedSolomon(4, 0x4),
					5: generateLargePayloadReedSolomon(4, 0x5),
					// 6: generateLargePayloadReedSolomon(4, 0x6),
				},
				pidToRepairPayload: map[protocol.ParityID][]byte{
					0: {23, 23, 23, 23, 0, 4},
					1: {16, 16, 16, 16, 0, 4},
				},
				totNumSourceSymbols:         6,
				totNumRepairSymbols:         2,
				biggestSourceSymbolLenSoFar: 4,
				smallestSSID:                1,
				largestSSID:                 6,
			},
			want:    []byte{0x1, 0x1, 0x1, 0x1, 0x6, 0x6, 0x6, 0x6},
			wantErr: false,
		},
		{
			name: "successful recovery with 20 source symbols and 10 repair symbols",
			scheme: reedSolomonScheme{enc: func() reedsolomon.Encoder {
				enc, err := reedsolomon.New(20, 10)
				if err != nil {
					t.Fatalf("failed to create reedsolomon encoder: %v", err)
				}
				return enc
			}()},
			block: &block{
				id: 2,
				ssidToSourcePayload: map[protocol.SourceSymbolID][]byte{
					// 20: generateLargePayloadReedSolomon(600, 0x1),
					21: generateLargePayloadReedSolomon(650, 0x2),
					22: generateLargePayloadReedSolomon(700, 0x3),
					23: generateLargePayloadReedSolomon(750, 0x4),
					// 24: generateLargePayloadReedSolomon(800, 0x5),
					25: generateLargePayloadReedSolomon(850, 0x6),
					// 26: generateLargePayloadReedSolomon(900, 0x7),
					// 27: generateLargePayloadReedSolomon(950, 0x8),
					28: generateLargePayloadReedSolomon(1000, 0x9),
					29: generateLargePayloadReedSolomon(1050, 0xA),
					30: generateLargePayloadReedSolomon(1100, 0xB),
					31: generateLargePayloadReedSolomon(1150, 0xC),
					32: generateLargePayloadReedSolomon(1200, 0xD),
					33: generateLargePayloadReedSolomon(1250, 0xE),
					34: generateLargePayloadReedSolomon(1300, 0xF),
					35: generateLargePayloadReedSolomon(1350, 0x10),
					36: generateLargePayloadReedSolomon(1400, 0x11),
					37: generateLargePayloadReedSolomon(1434, 0x12),
					// 38: generateLargePayloadReedSolomon(600, 0x13),
					// 39: generateLargePayloadReedSolomon(650, 0x14),
				},
				totNumSourceSymbols:         20,
				totNumRepairSymbols:         10,
				biggestSourceSymbolLenSoFar: 1434,
				smallestSSID:                20,
				largestSSID:                 39,
				pidToRepairPayload: map[protocol.ParityID][]byte{
					0: r0,
					4: r4,
					5: r5,
					7: r7,
					8: r8,
					9: r9,
				},
			},
			wantErr: false,
			want: func() []byte {
				var ret []byte = make([]byte, 0, 6*protocol.MaxFECPacketBufferSize)
				ret = append(ret, generateLargePayloadReedSolomon(600, 0x1)...)
				ret = append(ret, generateLargePayloadReedSolomon(800, 0x5)...)
				ret = append(ret, generateLargePayloadReedSolomon(900, 0x7)...)
				ret = append(ret, generateLargePayloadReedSolomon(950, 0x8)...)
				ret = append(ret, generateLargePayloadReedSolomon(600, 0x13)...)
				ret = append(ret, generateLargePayloadReedSolomon(650, 0x14)...)
				return ret
			}(),
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := tt.scheme.recoverSymbolPayloads(tt.block)
			if (err != nil) != tt.wantErr {
				t.Errorf("recoverSymbolPayloads() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("repairSymbols() got = %v, want %v", got, tt.want)
			}
		})
	}
}

